import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, Button, Menu, MenuItem } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import HomeIcon from '@mui/icons-material/Home';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { Link } from 'react-scroll';

function Header() {
    return (
        <AppBar position="static">
            <Toolbar>
                <IconButton edge="start" color="inherit" aria-label="menu">
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6" style={{ flexGrow: 1 }}>
                    <Link to="home" smooth={true} duration={1000}>
                        <HomeIcon />
                    </Link>
                </Typography>
                <Button color="inherit">Features<ExpandMoreIcon /></Button>
                <Menu id="features-menu" anchorEl={null} open={false}>
                    {/* Add menu items here */}
                </Menu>
                <Button color="inherit"><Link to="docs" smooth={true} duration={1000}>Docs</Link></Button>
                <Button color="inherit"><Link to="templates" smooth={true} duration={1000}>Templates</Link></Button>
                <Button color="inherit"><Link to="customers" smooth={true} duration={1000}>Customers</Link></Button>
                <Button color="inherit"><Link to="enterprise" smooth={true} duration={1000}>Enterprise</Link></Button>
                <Button color="inherit"><Link to="pricing" smooth={true} duration={1000}>Pricing</Link></Button>
                <Button color="inherit">Log In</Button>
                <Button color="inherit">Sign up</Button>
            </Toolbar>
        </AppBar>
    );
}

export default Header;
